 const dispatch = useDispatch();

 const { user } = useSelector((state) => state.auth);
 const { posts, isLoading, isError, message } = useSelector(
   (state) => state.posts
 );
useEffect(() => {
  console.log(2);
  if (isError) {
    console.log(message);
  }

  if (!user) {
    navigate('/login');
  }

  dispatch(getFeedPosts());

  return () => {
    dispatch(reset());
  };
}, [user, navigate, isError, message, dispatch]);


  return (
    <div>MyPosts</div>
  )
}

